import Navbar from "./Navbar";

const Cards = () => {
    
    
    const [caa, setcaa] = useState([]);
    const getdata = async () =>{
        const res = await fetch("https://api.themoviedb.org/3/trending/all/day?api_key=c9df0bb1b55da2720c721bcb3c0b5833");
        const actual = await res.json();
        console.log(actual.results[0]);
        setcaa(actual.results);
     };
   useEffect(()=>{
       getdata();
   } , []);
   const card = caa.filter((val) =>{
       return (val.media_type !== "tv")
   })

    return (
        card.map((val, index) => {
            return (<>
                <Navbar
                    key={index}
                    images = {`https://image.tmdb.org/t/p/w300${val.poster_path}`}
            title = {val.title}
            date = {val.release_date}
            btao = {val.media_type}
            links = "#"
                />

            </>
    )
            }))
};

export default Cards;
